const Ads = () => {
  return (
    <>
      <section className="Ads">
        <div className="container Ads">
          <div className="leftD">
            <div className="img">
              <img src="page.png" alt="phone layout" id="adImg" />
            </div>
          </div>
          <div className="rightD">
            <div className="row">
              <div className="lR"></div>
              <div className="rR"></div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Ads;
